import React, { Component } from 'react'
import './index.css'

export default class List extends Component {
    render() {
        return (
            <div className="row">
                <div className="card">
                    <a href="https://github.com/reactjs" rel="noopener noreferrer" target="_blank">
                        <img alt="avatar" src="http://106.54.10.35:8080/wp-content/uploads/2024/08/1724657351-dingzhen.png" style={{ width: '100px' }} />
                    </a>
                    <p className="card-text">reactjs</p>
                </div>
            </div>
        )
    }
}
